import React, { Component } from "react";

export default class App extends Component {
  constructor(props) {
    super(props);

    this.state = { result: {} };
  }

  async componentDidMount() {
    await fetch("./test")
      .then(res => res.json())
      .then(result =>
        this.setState(
          {
            result: result
          }
          // () => console.log(this.state)
        )
      )
      .catch(error => {
        console.log("Error", error);
      });

    console.log(this.state.result);
  }

  render() {
    return <div>test</div>;
  }
}
